import React, { Component } from 'react';
import { NavLink } from "react-router-dom";

const css = {
  position: "fixed",
  width: "200px",
  height:"560px",
  backgroundColor: "#004e92",
  marginLeft:"20px"
  
};
const in_css = {
  color: "#DDDDDD",
  
};
class Nav extends Component {
  render() {
    return (
     <div style={css}  className="list-group-item">
      <NavLink to="" className="" style={in_css} aria-controls="home">Home</NavLink> <br/>
      <NavLink to="" className="" style={in_css} aria-controls="home">Home</NavLink>
     
    
    </div>
    );
  }
}

export default Nav;
